div.CanvasXpressCode {
    border: 1px solid rgb(51, 122, 183);
    border-radius: 5px;

    background-color: rgba(255, 255, 255, 0.95);
    cursor: move;
    color: rgb(34, 34, 34);
    font: normal 12px arial, tahoma, sans-serif;
    margin: 2px 3px;
    padding: 18px;
    position: absolute;
    white-space: nowrap;
}

img.CanvasXpressCode, svg.CanvasXpressCode {
    background: rgba(0, 0, 0, 0) !important;
    border: 0px none !important;
    box-shadow: 0 0 0px rgba(0, 0, 0, 0) !important;
    cursor: default;
    float: right;
    margin: 5px 8px 0px 0px !important;
    -moz-user-select: none;
    -khtml-user-select: none;
    -webkit-user-select: none;
    -o-user-select: none;
    -ms-user-select: none;
}

pre.CanvasXpressCode {
    text-align: left;
    padding: inherit;
    margin: inherit;
    font-size: inherit;
    line-height: inherit;
    color: inherit;
    word-break: inherit;
    word-wrap: inherit;
    background-color: inherit;
    border: none;
    border-radius: inherit;
    counter-reset: line;
}

div.CanvasXpressCodeContainer {
    box-sizing: content-box;
    clear: both;
    max-height: 500px;
    max-width: 600px;
    overflow: auto;
    padding: 10px;
}

div.CanvasXpressCodeContent {
    box-sizing: content-box;
    margin: 2px 3px;
    padding: 2px 3px;
}

pre.CanvasXpressCodeContent {
    margin: 0 !important;
    padding: 0 !important;
    white-space: pre;
    font-size: inherit;
    line-height: inherit;
    color: inherit;
    border-radius: inherit;
}

pre.CanvasXpressCodeContent:before {
    counter-reset: listing;
}

pre.CanvasXpressCodeContent code {
    counter-increment: listing;
    white-space: inherit;
    line-height: 1.5;
}

pre.CanvasXpressCodeContent code::before {
    content: counter(listing) " ";
    display: inline-block;
    width: 3em;
    /* Fixed width */
    border-right: 1px solid #ddd;
    padding-left: auto;
    margin-left: auto;
    text-align: right;
    /*color: #888;*/
    background-color: #efefef;
    -webkit-user-select: none;
}


/*
 * Carousel
 */

div.CanvasXpressCarouselScene {
    position: relative;
    margin: 0;
}

div.CanvasXpressCarousel {
    width: 100%;
    height: 100%;
    position: absolute;
    transform: translateZ(-288px);
    transform-style: preserve-3d;
    transition: transform 1s;
}

span.CanvasXpressCarousel {
    padding: 1px;
    position: absolute;
    border: 1px solid rgb(51, 122, 183);
    border-radius: 2px;
    line-height: 10px;
    cursor: pointer;
}

div.CanvasXpressCarouselCell {
    position: absolute;
    transition: transform 1s, opacity 1s;
    background-color: rgba(255, 255, 255, 0.95);
    border: 1px solid rgb(51, 122, 183);
    border-radius: 5px;
    backface-visibility: hidden;
}

div.CanvasXpressCarouselCell:nth-child(1) {
    transform: rotateY( 0deg) translateZ(288px);
}

div.CanvasXpressCarouselCell:nth-child(2) {
    transform: rotateY( 40deg) translateZ(288px);
}

div.CanvasXpressCarouselCell:nth-child(3) {
    transform: rotateY( 80deg) translateZ(288px);
}

div.CanvasXpressCarouselCell:nth-child(4) {
    transform: rotateY(120deg) translateZ(288px);
}

div.CanvasXpressCarouselCell:nth-child(5) {
    transform: rotateY(160deg) translateZ(288px);
}

div.CanvasXpressCarouselCell:nth-child(6) {
    transform: rotateY(200deg) translateZ(288px);
}

div.CanvasXpressCarouselCell:nth-child(7) {
    transform: rotateY(240deg) translateZ(288px);
}

div.CanvasXpressCarouselCell:nth-child(8) {
    transform: rotateY(280deg) translateZ(288px);
}

div.CanvasXpressCarouselCell:nth-child(9) {
    transform: rotateY(320deg) translateZ(288px);
}

img.CanvasXpressCarousel:hover, svg.CanvasXpressCarousel:hover {
    -webkit-transform: scale(1.8, 1.8);
    -ms-transform: scale(1.8, 1.8);
    transform: scale(1.8, 1.8);
    transition-duration: 0.3s;
    -webkit-transition-duration: 0.3s;
    /* Safari */
    box-shadow: 10px 10px 5px #888888;
    z-index: 2;
    position: relative;
    cursor: pointer;
    background: rgba(0, 0, 0, 0) !important;
    border: 0px none !important;
    box-shadow: 0 0 0px rgba(0, 0, 0, 0) !important;
    margin: 0px !important;
}

div.CanvasXpressSlider {

    position: absolute;
    margin-left: 3px;
    margin-right: 3px;
    width: 36px;
}

div.CanvasXpressSliderRemote {
    background: rgba(0, 0, 0, 0);
    height: 36px;
    position: absolute;
    margin-left: 3px;
    margin-right: 3px;
    width: 36px;
}

div.CanvasXpressSlider:hover {
    background: rgba(0, 0, 0, 0.4);
}

@media screen and (max-width: 480px) {
    div.CanvasXpressSlider {
        width: 20px;
        height: 20px;
    }
}

div.CanvasXpressSliderLeft {
    left: -50px;
}

div.CanvasXpressSliderLeft img, div.CanvasXpressSliderLeft svg {
    margin: 5px 5px 3px 3px;
}

    div.CanvasXpressSliderLeft {
        left: -25px;
    }
    div.CanvasXpressSliderLeft img, div.CanvasXpressSliderLeft svg {
        margin: -4px 0px 0px -2px;
    }
}

div.CanvasXpressSliderRight {
    right: -50px;
}

div.CanvasXpressSliderRight img, div.CanvasXpressSliderRight svg {
    margin: 5px 3px 3px 8px;
}

@media screen and (max-width: 480px) {
    div.CanvasXpressSliderRight {
        right: -25px;
    }
    div.CanvasXpressSliderRight img, div.CanvasXpressSliderRight svg {
        margin: -4px -2px 0px 2px;
    }
}

div.CanvasXpressSliderDotsContainer {
    top: 25%;
}

div.CanvasXpressSliderDots {
    width: 10px;
    height: 10px;
}

@media screen and (max-width: 480px) {
    div.CanvasXpressSliderDots {
        width: 5px;
        height: 5px;
        margin-left: 1px;
        margin-right: 1px;
    }
}

input.CanvasXpressSlider,
select.CanvasXpressSlider {
    padding: 2px 3px 2px 2px;
    cursor: default;
    color: rgb(34, 34, 34);
    border-left: none;
    border-right: none;
    border-top: none;
    border-bottom: 1px solid rgb(51, 122, 183);
    background: rgba(0, 0, 0, 0);
    width: 100%;
    max-Width: 100%;
    line-height: 22px;
    margin: 0;
}

input.CanvasXpressSlider:focus,
select.CanvasXpressSlider:focus {
    outline: 0;
}

/*
 * full-screen-warning-container
 */

#full-screen-warning-container {
    background-color: transparent !important;
    opacity: 0.4 !important;
}

#full-screen-warning-container[fade-warning-out] {
    transition-property: opacity !important;
    transition-duration: 1ms !important;
    opacity: 0.0 !important;
}

#full-screen-warning-message {
    padding: 15px !important;
}

.full-screen-description {
    font-size: 100% !important;
}

#full-screen-domain-text {
    font-size: 100% !important;
    font-weight: bold !important;
}

.full-screen-approval-button,
#full-screen-remember-decision {
    font-size: 100% !important;
}

@media (min-width: 300px) {
    div.CanvasXpressBin {
        transform: scale(0.5);
    }
}

@media (min-width: 450px) {
    div.CanvasXpressBin {
        transform: scale(0.75);
    }
}

@media (min-width: 600px) {
    div.CanvasXpressBin {
        transform: scale(1);
    }
}


/* Genie Effect */

.genie {
    position: relative;
    background-repeat: no-repeat;
    background-size: cover;
}

.genie .genie-step {
    background-repeat: no-repeat;
    background-image: inherit;
    position: absolute;
}

.genie.genie-expand .genie-step {
    -moz-transition: background-position 800ms ease-in-out;
    -webkit-transition: background-position 800ms ease-in-out;
    -o-transition: background-position 800ms ease-in-out;
    -ms-transition: background-position 800ms ease-in-out;
    transition: background-position 800ms ease-in-out;
}

.genie.genie-collapse .genie-step {
    -moz-transition: all 300ms ease-in-out;
    -webkit-transition: all 300ms ease-in-out;
    -o-transition: all 300ms ease-in-out;
    -ms-transition: all 300ms ease-in-out;
    transition: all 300ms ease-in-out;
}

.genie.genie-collapse.change-pace .genie-step {
    -moz-transition: background-position 800ms ease-in-out;
    -webkit-transition: background-position 800ms ease-in-out;
    -o-transition: background-position 800ms ease-in-out;
    -ms-transition: background-position 800ms ease-in-out;
    transition: background-position 800ms ease-in-out;
}

.genie.genie-expand.change-pace .genie-step {
    -moz-transition: all 300ms ease-in-out;
    -webkit-transition: all 300ms ease-in-out;
    -o-transition: all 300ms ease-in-out;
    -ms-transition: all 300ms ease-in-out;
    transition: all 300ms ease-in-out;
}
